import { Route, Routes } from 'react-router-dom';
import './App.css';
import RegisterLogIn from './SignUp_SignIn/RegisterLogIn';



function App() {

  return (

    <>
      <div>
        <Routes>
          <Route path='/home' element={<RegisterLogIn/>} />
        </Routes>
      </div>
      <RegisterLogIn/>
    </>
  );
}

export default App;
